$(document).ready(function(){$("#f_upload").on("change",function(){$("#file-upload-label").html('<i class="fas fa-upload"></i> '+$(this).val())});var a=getUrlParams(window.location.search);if(a.error==1){$("#errorText").html("Your File was larger than "+a.max_file+"Bytes or not in the PNG/JPG format.");$("#errorAlert").slideDown("slow")}else{if(a.error>1&&a.error<=4){$("#errorText").html("An error occured. Please contact your Administrator. Error Id: "+a);$("#errorAlert").slideDown("slow")}}$(".close").each(function(){$(this).click(function(b){b.preventDefault();$(this).parent().slideUp("fast")})})});